import './App.css';
import { useEffect, useState } from 'react';
import { getAllCharacters } from './getAllCharacters';

function App() {
  const [characters, setCharacters] = useState([]);

  useEffect( () => {
    getAllCharacters().then((characters) => {
      setCharacters(characters)
      console.log(characters)
    })
  }, []);


  return (
    <div className="App">
      <ul>
        {characters.name}
      </ul>

    </div>
  );
}

export default App;
